vBPigEAAKA0ld0/KQYAAIAiIdgBAAAoBMEO\nAABAIQh2AAAACkGwAwAAUAiCHQAAgEIQ7AAAABSCYAcAAKAQBDsAAACFINgBAAAoBMEOAABA\nIf4PWOSMT71hVwEAAAAASUVORK5CYII="},"metadata":{"image/png":{"height":420,"width":420}},"output_type":"display_data"}],"source":["## Recoding the locations\n","McSentimentLocation$truncated_address <- sapply(strsplit(McSentimentLocation$store_address, \",\"), function(x) paste(x[1], x[2], sep = \",\"))\n","\n","## Getting a location wise color palette\n","color_palette <- rainbow(length(unique(McSentimentLocation$truncated_address)))\n","                                                \n","## Truncating the location address upto second comma\n","McSentimentLocation$location_code <- as.numeric(factor(McSentimentLocation$truncated_address))\n","\n","## Create a mapping of numeric codes to location names\n","code_location_mapping <- unique(McSentimentLocation[c(\"location_code\", \"truncated_address\")])\n","\n","## Combined location code and truncated address\n","code_location_mapping$combined_label <- paste(code_location_mapping$location_code, code_location_mapping$truncated_address, sep = \" - \")\n","                                                \n","# Plotting the stacked bar graph with numeric codes and location names in the legend\n","LocationSentiment <- ggplot(McSentimentLocation, aes(x = as.factor(location_code), y = score, fill = as.factor(location_code))) +\n","  geom_bar(stat = \"identity\", position = \"stack\", color = \"black\") +\n","  scale_fill_manual(values = rainbow(length(unique(McSentimentLocation$truncated_address))),\n","                    breaks = unique(McSentimentLocation$location_code),\n","                    labels = code_location_mapping$combined_label) +\n","  theme_minimal() +\n","  labs(title = \"Sentiment Scores for McDonald's Store Locations (US)\",\n","       x = \"Location Code\",  # Modify x-axis label\n","       y = \"Sentiment Score\") +\n","  theme(axis.text.x = element_text(angle = 60, hjust = 1),\n","        axis.